    "\1\1\10\0\1\1\1\0\6\1\15\0\1\1\3\0"+
    "\2\1\5\0\3\1\6\0\1\1\1\0\1\1\6\0"+
    "\1\1\55\0\5\1\6\0\1\1\2\0\1\1\5\0"+
    "\1\1\3\0\1\1\2\0\7\1\6\0\1\1\4\0"+
    "\4\1\1\0\3\1\1\11\13\0\2\1\22\0\1\1"+
    "\1\0\2\1\16\0\1\1\1\0\2\1\1\0\4\1"+
    "\4\0\6\1\26\0\1\1\1\0\1\1\31\0\7\1"+
    "\1\0\1\1\2\0\4\1\1\0\6\1\13\0\2\1"+
    "\16\0\10\1\3\0\4\1\14\0\1\11\4\1\4\0"+
    "\1\1\10\0\6\1\16\0";

  private static int [] zzUnpackAttribute() {
    int [] result = new int[2339];
    int offset = 0;
    offset = zzUnpackAttribute(ZZ_ATTRIBUTE_PACKED_0, offset, result);
    return result;
  }

  private static int zzUnpackAttribute(String packed, int offset, int [] result) {
    int i = 0;       /* index in packed string  */
    int j = offset;  /* index in unpacked array */
    int l = packed.length();
    while (i < l) {
      int count = packed.charAt(i++);
      int value = packed.charAt(i++);
      do result[j++] = value; while (--count > 0);
    }
    return j;
  }

